import React, {useEffect, useState} from 'react';
import './App.css';
// import { Questions } from "./components/questions";

function App() {
  const [question, setQuestion] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setQuestion(data.values[0][1]);
      })
    );
  }, [])

  // console.log(question);

  return (
    <div className="App">
      <p>{question}</p>
    </div>
  );
}

export default App;
